import React from 'react'

const Cart = () => {
  return (
    <>
        <div className="content grid product">
          {
            Ndata.map((value,index) => {
              return (
                <div className="box" key={index}>
                  <div className="img"></div>
                </div>
              )
            })
          }
        </div>
    </>
  )
}

export default Cart
